import { View, Text, TextInput } from 'react-native'
import React from 'react'

const Searchbar = () => {
  return (
    <View style={{backgroundColor:"red",width:"80%",height:30,alignSelf:'center'}}>
      <TextInput style={{height:30,backgroundColor:"white",alignSelf:'center'}}
      placeholder="enter city">
      </TextInput>
    </View>
  )
}

export default Searchbar
